window.bookSummaryJSON = "<p>Rose McKenzie is adapting to life with the Grih, and now that the threat of war with the Tecran is over, she's hoping to settle into what passes for a normal life far from Earth and everything she knows. When she gets the chance to join an exploration team who are going down to collect information from a planet in Grihan airspace, she jumps at the chance to stretch her legs and breathe some real air.</p> <p>But unknown to the Grih, someone is already on the planet, and they don't want anyone to know what they're up to. They ambush the exploration team and take them prisoner, but they don't realize they didn't get everyone. They didn't get Rose.</p> <p>With her lover, Dav, and his spaceship the Barrist lured away by a distress signal, Rose and Sazo, along with a furry friend Rose has made, are the exploration team's only hope at rescue.</p>"; 
